INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (401, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アヤネ", 2, 24001, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (402, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アヤネ", 1, 24002, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (403, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アヤネ", 2, 24003, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (701, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アサヒ", 2, 24004, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (702, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アサヒ", 1, 24005, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (703, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アサヒ", 2, 24006, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (801, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "部員３", 2, 24007, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (802, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "部員３", 1, 24008, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (803, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "部員３", 2, 24009, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (501, 192501, "やった！", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "", 1, 24010, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (502, 192501, "勝ったよ！", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "", 1, 24011, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (503, 192501, "いい調子！", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "", 1, 24012, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (111, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 6, 24013, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (112, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 1, 24014, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (113, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 1, 24015, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (611, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ダイチ", 1, 24016, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (612, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ダイチ", 1, 24017, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (613, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ダイチ", 2, 24018, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (211, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ハツネ", 2, 24019, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (212, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ハツネ", 2, 24020, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (213, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ハツネ", 1, 24021, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (311, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "カヤ", 1, 24022, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (312, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "カヤ", 1, 24023, 2, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (313, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "カヤ", 6, 24024, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (421, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アヤネ", 4, 24025, 3, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (721, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "アサヒ", 2, 24026, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (821, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "部員３", 1, 24027, 3, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (521, 192501, "いい勝負だったよ\nまたやろうね", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "", 1, 24028, 1, 0.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (101, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 1, 24029, 2, -360.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (102, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 1, 24030, 2, -360.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (103, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 2, 24031, 2, -360.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (104, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 2, 24032, 1, -360.0);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES (105, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 0.0, 10046, "2020/07/31 12:00:00", "2030/12/17 14:59:59", 24, "ミサト", 1, 24033, 2, -360.0);
